import './App.css';
import React from 'react';
import Header from "./Components/Header/Header.js";
import OptionsBar from "./Components/OptionsBar/OptionsBar.js";
import HomeScreen from "./Containers/HomeScreen/HomeScreen.js";
import headshot from './Assets/Headshot.png';

function App() {

  return (
    <div className="App">
      <Header />
      <OptionsBar />
      {OptionsBar.buttonClicked}
      {OptionsBar.buttonClicked == 1 ?
      <HomeScreen />
      : <div> test </div>}
    </div>

  );
}

export default App;
